/*
*  Name_file :Router.js
*  Description: contiene rutas asociadas a componentes
*/

import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
//import Login from '../components/pages/login/Login';

import Home from '../components/pages/home/Home';

import HomeAdmin from '../components/pages/admin/HomeAdmin';

import HomeTeacher from '../components/pages/teacher/HomeTeacher';

import HomeStudent from '../components/pages/student/HomeStudent';
import GroupStudent from '../components/pages/student/GroupStudent';
import Writing from '../components/pages/student/Writing';

//<Route exact path="/login" component={Login} />

/*defino las rutas de los componentes
ejemplo ruta o url del login donde estara alojado/relacionado el componente Login*/
function Routes() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={Home} />
        
        

        <Route exact path="/homeAdmin" component={HomeAdmin} />
        <Route exact path="/homeTeacher" component={HomeTeacher} />
        <Route exact path="/homeStudent" component={HomeStudent} />

        <Route exact path="/groupStudent" component={GroupStudent} />
        <Route exact path="/writing" component={Writing} />



      </Switch>
    </BrowserRouter>
  );
}

export default Routes;
